2.1 Com o objetivo de melhor a qualidade do atendimento ao público externo bem como aperfeiçoamento da comunicação interna da instituição, a Diretoria do CRP SP propôs um treinamento sobre "Comunicação não violenta" a ser realizado dia 20/12/2024 com todos os trabalhadores da instituição, Sede e Subsedes. Para que o evento possa ser realizado, serão necessárias as contratações de serviços de locação de espaços, equipamentos, internet, café de boas-vindas e lanche;

2.2 Promover um treinamento sobre Comunicação Não Violenta (CNV) em um órgão público pode trazer benefícios tanto para os servidores quanto para a organização como um todo. Algumas justificativas para a implementação de um treinamento desse tipo incluem: Desenvolver uma comunicação mais empática e respeitosa no atendimento, visando reduzir mal entendidos, frustrações e conflitos em interações cotidiana, resultando em um atendimento mais eficaz e satisfatório com foco na prática de resolução de problemas;

2.3 Este treinamento visa facilitar a colaboração e o trabalho em equipe entre servidores públicos, pois incentiva a utilização de uma uma escuta ativa e uma expressão clara das necessidades e sentimentos, bem como promover um ambiente mais inclusivo e acolhedor, onde o princípio básico é o respeito, embatia e compreensão mútua,  o que pode reduzir a ocorrência de conflitos internos e melhorar o clima organizacional;

2.4 O curso capacitará os servidores a lidarem com conflitos de maneira construtiva, pois oferece ferramentas para lidar com divergências sem escalonar agressões, sendo um recurso importante para a mediação de conflitos no ambiente de trabalho ou no atendimento do público externo; A Comunicação Não Violenta pode ser um potente agente de transformação no ambiente público, tanto para os servidores quanto para os cidadãos atendidos. Ao promover o entendimento, o respeito e a empatia, o treinamento em CNV ajuda a fortalecer a administração pública, criando um ambiente mais colaborativo, eficaz e humano;

